create table TemperaturaCidade (
  id int AUTO_INCREMENT primary key ,
  valor double,
  dataa date,
  cidade varchar,
  fkestado varchar, 
  regiao varchar,
  FOREIGN KEY (fkestado) REFERENCES Regioes(estado)  
);

create table Regioes (
  estado varchar primary key,
  regiao varchar
);
